func TestNumberOfSubarrays(t *testing.T) {

	for _ , test :=range tests {
		if actual := NumberOfSubarrays(test.nums,test.k); actual != test.result {
			t.Errorf("got %d , expected %d", actual, test.result)
		}
	}
}

